adverts.description:
Машина в идеальном техническом состоянии. Друг семьи покупал новую у дилера, после - авто эксплуатировалось в нашей семье. На 80% трассовый пробег, замена масла каждые 7-8 т.км, все ТО по регламенту и необходимости. 2 комплекта резины (лето - Michelin Lattitude, зима - Nokia Hakkapelita). 
Без ДТП, не красился ни один элемент, есть некритичные моменты за время эксплуатации. 
Есть вся история обслуживания.

Очень приятная комплектация:
- белоснежный салон, красивый цвет дерева; 
- пневмоподвеска;
- комфортные 14 позиционные сиденья с памятью, поясничной опорой и боковой поддержкой;
- подогрев руля, передних и задних сидений;
- система объёмного звучания Harman/Kardon 
- адаптивные LED фары с ассистентом автоматического дальнего света по секциям (не слепит попутные и встречные авто);
- head-up дисплей (проекция на лобовое);
- комфортный (бесключевой) доступ;
- парктроники перед/зад с ассистентом парковки, камера 360;
- декоративная подсветка салона /ambient light/ в семи цветовых вариантах
- auto hold, голосовое управление, память руля, система start/stop, navi, громкая связь, bluetooth, датчики света и дождя;
- доводчики дверей и крышки багажника;
- автоматическое распознавание дорожных знаков и др;

Два ключа, в машине никогда не курили, очень бережная эксплуатация.

Набирайте, отвечу на любые вопросы. 

Машине к продаже специально не готовилась, приезжайте - смотрите реальное состояние. 
Возможна проверка на любом вашем СТО.
В помощи в продаже не нуждаемся, авто эксплуатируется на ежедневной основе. Аргументированный торг приветствуется.

Возможен обмен на Tesla Model Y со светлым салоном с нашей доплатой.
